    [],nt"revision_timestamp": "2016-08-03T03:15:57.573626",nt"name": "water-level-altitude-contours-for-the-diamond-valley-flow-system-central-nevada-2012",nt"isopen":
    false,nt"url": null,nt"notes": "These data were created as part of a hydrologic
    study to characterize groundwater budgets and water quality in the Diamond Valley
    Flow System (DVFS), central Nevada. This dataset represents 2012 water levels in
    the DVFS. Water level contours were developed using data from wells primarily measured
    in 2012 although earlier water level data in select wells were used in cases where
    no new data were available and water levels were not expected to have changed over
    time. Detailed information about the sites used to construct these contours is available
    in the larger work citation listed in this document.",nt"license_title": null,nt"extras":
